<?php
/**
 * Install sample style kits.
 *
 * @package AnalogWP
 * @since   1.2
 */

namespace Analog;

/**
 * Class Install_Stylekits.
 *
 * @package Analog
 */
class Install_Stylekits extends Base {
	/**
	 * Perform Style kits install.
	 *
	 * @return bool False is succeeded, true if has errors.
	 */
	public function perform_install() {
		$posts      = self::post_data();
		$has_errors = false;

		foreach ( $posts as $post ) {
			$post = wp_insert_post(
				array(
					'post_type'   => 'ang_tokens',
					'post_status' => 'publish',
					'post_title'  => $post['title'],
					'post_name'   => $post['slug'],
					'meta_input'  => array(
						'belongs_to'   => '',
						'_tokens_data' => $post['meta'],
					),
				)
			);

			if ( is_wp_error( $post ) ) {
				$has_errors = true;
			}
		}

		return $has_errors;
	}

